import ExcerciseForm from '../components/ExcerciseForm'
import Card from '../components/Card'

class ExcerciseNew extends React.Component {

    state = {}

    handleChange = e => {
        this.setState({
            [e.target.name] : e.target.value
        })
    }

    render(){
        return (
            <ExcerciseForm
                onChange={this.handleChange}
            />
        )
    }
}

